import Menu from './Menu.js';
import React, {lazy, Route} from 'react';
const HomePage = lazy(() => import('./components/HomePage.js'));

const Header = () => {
    return(
        <div id='header'>


            <h2>
                <Route path="/" exact component={HomePage} />
                Logo
            </h2>
            <Menu />
        </div>
    )
}

export default Header;
